#include <iostream>
#include <fstream>
#include <iterator>
#include <ostream>
#include <string>
#include <vector>
#include <algorithm>

int main(int argc , char** argv) {
    std::string input = "";
    int i = 3;
    while(input[i] == input[i-1] 
          || input[i] == input [i-2]
          || input[i] == input [i-3]
          || input[i-1] == input[i-2]
          || input[i-1] == input[i-3]
          || input[i-2] == input[i-3])
        i++;
    
    std::cout << i + 1 << std::endl;

    i = 13;
    bool repeat = true;
    while(repeat){
        repeat = false;
        for(int ii = i; ii > i-14; ii--){
            for(int jj = ii - 1; jj > i - 14; jj--){
                repeat |= input[ii] == input[jj];
            }
        }
        i++;
    }
    std::cout << i << std::endl;
}
